import React from 'react';

function Card(){
    return(
    <div className="cards">
        <div className="card">
            <img src="https://occ-0-2797-1007.1.nflxso.net/dnm/api/v6/E8vDc_W8CLv7-yMQu8KMEC7Rrr8/AAAABcyX6tcxJg2whhmzIPD-qHiAYlV5XeEbxtAyftG_AKKYL99KL67yT2oSareJScfBwQS_5VIGPu5Eh4L3l3Co1xWk3f-J.jpg?r=2c5" alt="myPic" className="card__img" />
            <div className="card__info">
                <span className="card__category"> A Netflix Original Series </span>
                <h3 className="class__title">ANNE WITH AN 'E'</h3>
                <a href="https://www.netflix.com/np/title/80136311" target="_blank">
                    <button>Watch Now</button>
                </a>
            </div>
        </div>
    </div>
    );
}

export default Card;
